import { GraphData, Matrix } from "./types";

const adjMatrix = (graphData: GraphData, directed?: boolean) => {
  const { nodes, edges } = graphData;
  const matrix: Matrix[] = [];
  // map node with index in data.nodes
  const nodeMap: {
    [key: string]: number;
  } = {};

  if (!nodes) {
    throw new Error("invalid nodes data!");
  }

  if (nodes) {
    nodes.forEach((node, i) => {
      nodeMap[node.id] = i;
      const row: number[] = [];
      matrix.push(row);
    });
  }

  if (edges) {
    edges.forEach((edge) => {
      const { source, target } = edge;
      const sIndex = nodeMap[source as string];
      const tIndex = nodeMap[target as string];
      if ((!sIndex && sIndex !== 0) || (!tIndex && tIndex !== 0)) return;
      matrix[sIndex][tIndex] = 1;
      if (!directed) {
        matrix[tIndex][sIndex] = 1;
      }
    });
  }
  return matrix;
};

export default adjMatrix;
const defaultComparator = (a, b) => {
  if (a === b) {
    return true;
  }

  return false;
}

/**
 * 
 */
export class LinkedListNode {
  public value;

  public next: LinkedListNode;

  constructor(value, next: LinkedListNode = null) {
    this.value = value;
    this.next = next;
  }

  toString(callback?: any) {
    return callback ? callback(this.value) : `${this.value}`;
  }
}

export default class LinkedList {
  public head: LinkedListNode;

  public tail: LinkedListNode;

  public compare: Function;

  constructor(comparator = defaultComparator) {
    this.head = null;
    this.tail = null;
    this.compare = comparator;
  }

  /**
   * 
   * @param value
   */
  prepend(value) {
    // 
    const newNode = new LinkedListNode(value, this.head);
    this.head = newNode;

    if (!this.tail) {
      this.tail = newNode;
    }

    return this;
  }

  /**
   * 
   * @param value
   */
  append(value) {
    const newNode = new LinkedListNode(value);

    // 
    if (!this.head) {
      this.head = newNode;
      this.tail = newNode;

      return this;
    }

    // 
    this.tail.next = newNode;
    this.tail = newNode;

    return this;
  }

  /**
   * 
   * @param value 
   */
  delete(value): LinkedListNode {
