export default class Queue {
  public linkedList: LinkedList;

  constructor() {
    this.linkedList = new LinkedList();
  }

  /**
   * 
   */
  public isEmpty() {
    return !this.linkedList.head;
  }

  /**
   *  
   */
  public peek() {
    if (!this.linkedList.head) {
      return null;
    }
    return this.linkedList.head.value;
  }

  /**
   * 
   * @param value
   */
  public enqueue(value) {
    this.linkedList.append(value);
  }

  /**
   *  null
   */
  public dequeue() {
    const removeHead = this.linkedList.deleteHead();
    return removeHead ? removeHead.value : null;
  }

  public toString(callback?: any) {
    return this.linkedList.toString(callback);
  }
}
import { EdgeConfig, GraphData, Matrix } from './types'

/**
 * 
 * @param nodeId  ID
 * @param edges 
 * @param type 
 */
export const getNeighbors = (nodeId: string, edges: EdgeConfig[] = [], type?: 'target' | 'source' | undefined): string[] => {
  const currentEdges = edges.filter(edge => edge.source === nodeId || edge.target === nodeId)
  if (type === 'target') {
    //  source
    const neighhborsConverter = (edge: EdgeConfig) => {
      return edge.source === nodeId;
    };
    return currentEdges.filter(neighhborsConverter).map((edge) => edge.target);
  }
  if (type === 'source') {
    //  target
    const neighhborsConverter = (edge: EdgeConfig) => {
      return edge.target === nodeId;
    };
    return currentEdges.filter(neighhborsConverter).map((edge) => edge.source);
  }

  //  type 
  const neighhborsConverter = (edge: EdgeConfig) => {
    return edge.source === nodeId ? edge.target : edge.source;
  };
  return currentEdges.map(neighhborsConverter);
}

/**
 * 
 * @param nodeId  ID
 * @param edges 
 */
export const getOutEdgesNodeId = (nodeId: string, edges: EdgeConfig[]) => {
  return edges.filter(edge => edge.source === nodeId)
}

/**
 * 
 * @param nodeId  ID
 * @param edges 
 */
export const getEdgesByNodeId = (nodeId: string, edges: EdgeConfig[]) => {
  return edges.filter(edge => edge.source === nodeId || edge.target === nodeId)
}

/**
 *  ID + 
 * @param index 
 */
export const uniqueId = (index: number = 0) => {
  const random1 = `${Math.random()}`.split('.')[1].substr(0, 5);
  const random2 = `${Math.random()}`.split('.')[1].substr(0, 5);
  return `${index}-${random1}${random2}`
};
import { GraphData, DegreeType } from "./types";

const degree = (graphData: GraphData): DegreeType => {
  const degrees: DegreeType = {};
  const { nodes = [], edges = [] } = graphData

  nodes.forEach((node) => {
    degrees[node.id] = {
      degree: 0,
      inDegree: 0,
      outDegree: 0,
    };
  });

  edges.forEach((edge) => {
    degrees[edge.source].degree++;
    degrees[edge.source].outDegree++;
    degrees[edge.target].degree++;
    degrees[edge.target].inDegree++;
  });

  return degrees;
};

export default degree;

/**
 * 
 * @param graphData 
 * @param nodeId ID
 */
export const getInDegree = (graphData: GraphData, nodeId: string) => {
  const nodeDegree = degree(graphData)
  if (nodeDegree[nodeId]) {
    return degree(graphData)[nodeId].inDegree
  }
  return 0
}

/**
 * 
 * @param graphData 
 * @param nodeId ID
 */
export const getOutDegree = (graphData: GraphData, nodeId: string) => {
  const nodeDegree = degree(graphData)
  if (nodeDegree[nodeId]) {
    return degree(graphData)[nodeId].outDegree
  }
  return 0
}
import { IAlgorithmCallbacks, GraphData } from './types'
import { getNeighbors } from './util'

function initCallbacks(callbacks: IAlgorithmCallbacks = {} as IAlgorithmCallbacks) {
  const initiatedCallback = callbacks;

  const stubCallback = () => {};

  const allowTraversalCallback = (() => {
    const seen = {};
    return ({ next }) => {
      if (!seen[next]) {
        seen[next] = true;
        return true;
      }
      return false;
    };
  })();

  initiatedCallback.allowTraversal = callbacks.allowTraversal || allowTraversalCallback;
  initiatedCallback.enter = callbacks.enter || stubCallback;
  initiatedCallback.leave = callbacks.leave || stubCallback;

  return initiatedCallback;
}

/**
 * @param {Graph} graph
 * @param {GraphNode} currentNode
 * @param {GraphNode} previousNode
 * @param {Callbacks} callbacks
 */
function depthFirstSearchRecursive(
  graphData: GraphData,
  currentNode: string,
  previousNode: string,
  callbacks: IAlgorithmCallbacks,
) {
  callbacks.enter({
    current: currentNode,
    previous: previousNode,
  });

  const { edges = [] } = graphData

  getNeighbors(currentNode, edges, 'target').forEach((nextNode) => {
    if (
      callbacks.allowTraversal({
        previous: previousNode,
        current: currentNode,
        next: nextNode,
      })
    ) {
      depthFirstSearchRecursive(graphData, nextNode, currentNode, callbacks);
    }
  });

  callbacks.leave({
    current: currentNode,
    previous: previousNode,
  });
}

/**
 * 
 * @param data GraphData 
 * @param startNodeId  ID
 * @param originalCallbacks 
 */
export default function depthFirstSearch(
  graphData: GraphData,
  startNodeId: string,
  callbacks?: IAlgorithmCallbacks,
) {
  depthFirstSearchRecursive(graphData, startNodeId, '', initCallbacks(callbacks));
}
