/**
 *
 * @param callbacks
 * allowTraversal:  BFS 
 * enterNode:  BFS 
 * leaveNode:  BFS 
 */
function initCallbacks(callbacks: IAlgorithmCallbacks = {} as IAlgorithmCallbacks) {
  const initiatedCallback = callbacks;

  const stubCallback = () => {};

  const allowTraversalCallback = (() => {
    const seen = {};
    return ({ next }) => {
      const id = next;
      if (!seen[id]) {
        seen[id] = true;
        return true;
      }
      return false;
    };
  })();

  initiatedCallback.allowTraversal = callbacks.allowTraversal || allowTraversalCallback;
  initiatedCallback.enter = callbacks.enter || stubCallback;
  initiatedCallback.leave = callbacks.leave || stubCallback;

  return initiatedCallback;
}

/**
 * 
 * @param graph Graph 
 * @param startNode 
 * @param originalCallbacks 
 */
const breadthFirstSearch = (
  graphData: GraphData,
  startNodeId: string,
  originalCallbacks?: IAlgorithmCallbacks,
) => {
  const callbacks = initCallbacks(originalCallbacks);
  const nodeQueue = new Queue();

  const { edges = [] } = graphData

  // 
  nodeQueue.enqueue(startNodeId);

  let previousNode = '';

  // 
  while (!nodeQueue.isEmpty()) {
    const currentNode: string = nodeQueue.dequeue();
    callbacks.enter({
      current: currentNode,
      previous: previousNode,
    });

    // 
    getNeighbors(currentNode, edges, 'target').forEach((nextNode) => {
      if (
        callbacks.allowTraversal({
          previous: previousNode,
          current: currentNode,
          next: nextNode,
        })
      ) {
        nodeQueue.enqueue(nextNode);
      }
    });

    callbacks.leave({
      current: currentNode,
      previous: previousNode,
    });

    // 
    previousNode = currentNode;
  }
};

